import React, { useState, useEffect } from 'react';

function YouTubeChannel() {
    const [channelId, setChannelId] = useState('');
    const [subscriberCount, setSubscriberCount] = useState('');

    useEffect(() => {
        const fetchData = async () => {
            const response = await fetch(
                `https://www.googleapis.com/youtube/v3/channels?part=statistics&id=${channelId}&key=AIzaSyDnQnC0TzwCC_kaH2NJfdZG61kEfAeRM3Q`
            );
            const data = await response.json();
            setSubscriberCount(data.items[0].statistics.subscriberCount);
        };
        fetchData();
    }, [channelId]);

    const handleSubmit = (event) => {
        event.preventDefault();
        fetchData();
    };

    return (
        <div>
            <h1>YouTube Channel Subscriber Count</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Enter YouTube Channel ID:
                    <input type="text" value={channelId} onChange={(e) => setChannelId(e.target.value)} />
                </label>
                <button type="submit">Get Subscriber Count</button>
            </form>
            <p>{subscriberCount}</p>
        </div>
    );
}

export default YouTubeChannel;
